  function safeAlpacaTransfer(address _to, uint256 _amount) internal {
    uint256 alpacaBal = alpaca.balanceOf(address(this));
    if (_amount > alpacaBal) {
      alpaca.transfer(_to, alpacaBal);
    } else {
      alpaca.transfer(_to, _amount);
    }
  }
}

